import React, { Component } from 'react';

class Message extends Component {

  render() {
    const { message, actions } = this.props;

    return (
      <div>
        <li>
          {message.detail}
        </li>
        <button onClick={_=> actions.deleteMessage(message.id)}> X </button>
      </div>
    );
  }

};

export default Message;
